// src/components/Manager.js

import React from "react";
import { useNavigate } from "react-router-dom";

const Manager = () => {
  const navigate = useNavigate();

  const goTo = (path) => {
    navigate(path);
  };

  return (
    <div style={{ padding: "30px", textAlign: "center" }}>
      <h2>üë©‚Äçüíº Manager Dashboard</h2>

      <div style={{ display: "grid", gridTemplateColumns: "repeat(2, 1fr)", gap: "20px", marginTop: "30px" }}>
        <button onClick={() => goTo("/drink-menu")}>Drink Menu</button>
        <button onClick={() => goTo("/inventory")}>Inventory</button>
        <button onClick={() => goTo("/trends")}>Trends</button>
        <button onClick={() => goTo("/employee")}>Employee</button>
        <button onClick={() => goTo("/")}>Orders</button>
        <button onClick={() => goTo("/add-seasonal")}>Add Seasonal Menu Item</button>
        <button onClick={() => goTo("/product-usage")}>Product Usage</button>
        <button onClick={() => goTo("/x-report")}>X-Report</button>
        <button onClick={() => goTo("/z-report")}>Z-Report</button>
        <button onClick={() => goTo("/")}>Logout</button>
      </div>
    </div>
  );
};

export default Manager;
